import React, {useState} from 'react'
import OwlCarousel from "react-owl-carousel";
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import slide1 from '../../headers/icon/slide1.png'
import slide2 from '../../headers/icon/slide2.jpg'
import slide3 from '../../headers/icon/slide3.jpg'
import Loading from '../utils/Loading/Loading'

function Homepage() {
    const [loading, setLoading] = useState(false)
    
    if(loading) return <div><Loading /></div>
    return (
      
        <div>
           <OwlCarousel className="owl-theme carsoul" loop margin={10} items={1} autoplay={true} autoplayTimeout={5000} autoplaySpeed={2500}>
                <img src={slide1} />
                <img src={slide2} />
                <img src={slide3} /> 
            </OwlCarousel>    
        </div>
      
    )
}

export default Homepage
